import React from "react";
import { Row, Col, Button, Table, Container } from "react-bootstrap";
import { useSelector } from "react-redux";
import profile from "../components/profile.jpg";
import { Paper } from "@mui/material";
import Spacer from "react-add-space";

const Worker = () => {
  const worker = useSelector((state) => state.dataw.worker);
  return (
    <>
      <div className="container-picture">
        <Container>
          <Row xs={10} md={4}>
            <Col>
              <img src={profile} className="rounded" alt="Pic"></img>
            </Col>

            <Col xs={8}>
              <Paper style={{ marginTop: "35px" }} elevation={2}>
                <h4>Basic information</h4>
                <h6>
                  Name: <Spacer amount={30} />
                  {worker.fName}
                </h6>
                <h6>
                  Email: <Spacer amount={30} /> {worker.email}
                </h6>
                <h6>
                  Phone Number: <Spacer amount={8} /> {worker.phoneNumber}
                </h6>
                <h6>
                  Gender: <Spacer amount={25} /> male
                </h6>
                <h6>
                  Driving License: <Spacer amount={7} /> Bus
                </h6>
                <h6>
                  Age: <Spacer amount={33} /> {worker.age}
                </h6>
                <h6>
                  Age: <Spacer amount={33} /> {worker.age}
                </h6>
                <h6>
                  Age: <Spacer amount={33} /> {worker.age}
                </h6>
                <h6>
                  Age: <Spacer amount={33} /> {worker.age}
                </h6>
              </Paper>
            </Col>
          </Row>
          <Button style={{ marginLeft: "60px" }} variant="info">
            Change Profile Pitcure
          </Button>
        </Container>
      </div>
    </>
  );
};

export default Worker;
